import React from "react";

const PlayIcon = () => {
  return (
    <svg className="icon-play" viewBox="0 0 85 100" width="15" height="15">
      <path
        fill="currentColor"
        d="M81 44.6c5 3 5 7.8 0 10.8L9 98.7c-5 3-9 .7-9-5V6.3c0-5.7 4-8 9-5l72 43.3z"
      />
    </svg>
  );
};

export default PlayIcon;
